CC[r1_,l1_,r2_,l2_,q_,t_]:=
Module[{q0,q1,q2,q3,tx,ty,tz,\[Theta]1,\[Theta]2,d,ret,mind,mini,solk1,ar3,ar,k1,nsolutions,ii,restol1,realsolns,tmp,p1,p2,sol\[Theta]2,polyk1},
Print["We are in CC now"];
Print[r1,l1,r2,l2,q,t];
{q0,q1,q2,q3}=q;
{tx,ty,tz}=t;
p1={r1 Cos[\[Theta]1],r1 Sin[\[Theta]1],0};
p2={tx+(q0^2+q1^2-q2^2-q3^2) r2 Cos[\[Theta]2]+(2 q1 q2-2 q0 q3) r2 Sin[\[Theta]2],ty+(2 q1 q2+2 q0 q3) r2 Cos[\[Theta]2]+(q0^2-q1^2+q2^2-q3^2) r2 Sin[\[Theta]2],tz+(-2 q0 q2+2 q1 q3) r2 Cos[\[Theta]2]+(2 q0 q1+2 q2 q3) r2 Sin[\[Theta]2]};

