sol\[Theta]2=ccsol\[Theta]2f[\[Theta]1,\[Theta]2,r1,l1,r2,l2,q,t];

solk1=Solve[(polyk1)==0,k1];
Print[solk1];
nsolutions=Array[0&,{Length[solk1],2}];
For[ii=1,ii<=Length[solk1],ii++,
nsolutions[[ii]]=Flatten[{\[Theta]1->Chop[2 ArcTan[k1]/.solk1[[ii]]],sol\[Theta]2/.(\[Theta]1->Chop[2 ArcTan[k1]/.solk1[[ii]]])}];
];


(*filtering out real solutions*)
restol1=10^-3;
realsolns={};
For[ii=1,ii<= Length[nsolutions],ii++,
tmp={\[Theta]1,\[Theta]2}/.nsolutions[[ii]];
If[Abs[Im[tmp]][[1]]<=  restol1 && Abs[Im[tmp]][[2]]<= restol1 ,realsolns=Append[realsolns,nsolutions[[ii]]]]
];


mind=d/.realsolns[[1]];
mini=1;
Print[realsolns[[1]]];
Print["d=",d/.realsolns[[1]]];
For[ii=2,ii<= Length[realsolns],ii++,
Print[realsolns[[ii]]];
Print["d=",d/.realsolns[[ii]]];
If[(d/.realsolns[[ii]])<mind,mind=(d/.realsolns[[ii]]);mini=ii]
];
ret={p1/.realsolns[[mini]],p2/.realsolns[[mini]],mind,{\[Theta]1,\[Theta]2}/.realsolns[[mini]]};
Return[ret];
]



